import "./dashbb.css";
import {useLocation} from "react-router"

export default function Dashbb() {
  const location = useLocation()
  console.log(location.split("/"))
  return (
    <div className="dashbb-g">
      <div className="row-md">
          <div className="book">
            <ul>
              <li style={{fontSize: "2em"}}>Hello<p className="purchase-count" style={{fontSize: "0.5em"}}>Sold: 20</p></li>
            </ul>
          </div>
      </div>
    </div>
  );
}
